import React from "react";
import Amplitude from "amplitudejs";
import Song from "./Song";

function Playlist(length) {
  var getSongs = length => {
    let lst = [];
    for (let i = 0; i < length; i++){
      Song(i);
    }
    return lst;
  }

  return (
    <div>
      {getSongs}
    </div>

  )
  }
export default Playlist;
